const Header = () => {
    return ( 
        <div><Navbar bg="dark" variant="dark">
        <Container>
        <Navbar.Brand href="#home">Discount Picker</Navbar.Brand>
        <Nav className="me-auto">
          <Nav.Link href="#home">Home</Nav.Link>
          <Nav.Link href="#features">Promos</Nav.Link>
          <Nav.Link href="#pricing">A propos</Nav.Link>
        </Nav>
        </Container>
      </Navbar></div>
     );
}
 
export default Header;
